import React, { Component } from 'react'
import './style.css'; 

const Resturant = () => {
    const myStyle={color:"red"}
  return (
    <div> 
        <div className="card-container">
            <div className="card">
                <div className="card-body">
                    <span className="card-number card-circle subtle">1</span>
                    <span className="card-author subtle" style={myStyle}>Breakfast</span>
                    <span>
Maggi was the first to bring protein-rich legume meals to the market, and followed up with a ready-made soup based on legume meals in 1886. After that Julius Maggi introduced bouillon concentrates, first in capsules, then in cubes. In 1897, Julius Maggi founded the company Maggi GmbH in Singen, Germany.</span>
                </div>
            </div>
        </div>
    </div>
  )
}

export default Resturant
